        ></textarea>
      </div>
      <div className="flex justify-center p-10">
        <button class="bg-red-700 hover:bg-red-800 text-white font-bold py-2 px-4 rounded">
          Evalute
        </button>
      </div>
    </div>
  );
}

export default App;
